-
Consider a colour that will grow out well, meaning you can go longer between appointments.
-
Skip a wash day every now and then. Washing every day is a big NO if you want your strands to stay healthy. Try pushing it an extra day - use a good dry shampoo to help get you through. 
-
If you want a big colour change, take it slow. Your hair will thank you.
-
Protect from heat - use a heat protector before using any hot tools (even blow dryer). And, try skipping the tools all together as much as you can. A loose upstyle or braid can help keep you feeling cute, but save on hair stress.
-
